import React, { useState } from 'react';

const Contact = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    subject: '',
    message: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form submitted:', formData);
    setFormData({
      name: '',
      email: '',
      subject: '',
      message: ''
    });
    alert('Merci pour votre message! Nous vous répondrons bientôt.');
  };

  return (
    <div className="relative min-h-screen w-full bg-cover bg-center flex items-center justify-center py-12 px-4" style={{ backgroundImage: "url('https://images.unsplash.com/photo-1506744038136-46273834b3fb?auto=format&fit=crop&w=1400&q=80')" }}>
      {/* Overlay */}
      <div className="absolute inset-0 bg-black/70 z-0" />
      {/* Content */}
      <div className="relative z-10 w-full max-w-5xl mx-auto flex flex-col md:flex-row gap-8 items-stretch justify-center">
        {/* Form */}
        <form onSubmit={handleSubmit} className="flex-1 bg-white/90 rounded-2xl shadow-xl p-8 flex flex-col gap-6 backdrop-blur-md">
          <h1 className="text-2xl font-bold text-gray-800 text-center mb-2">Contactez-nous</h1>
          <div className="flex flex-col gap-2">
            <label htmlFor="name" className="font-semibold text-gray-700">Nom</label>
            <input type="text" id="name" name="name" value={formData.name} onChange={handleChange} required className="px-4 py-2 rounded-lg border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-400" />
          </div>
          <div className="flex flex-col gap-2">
            <label htmlFor="email" className="font-semibold text-gray-700">Email</label>
            <input type="email" id="email" name="email" value={formData.email} onChange={handleChange} required className="px-4 py-2 rounded-lg border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-400" />
          </div>
          <div className="flex flex-col gap-2">
            <label htmlFor="subject" className="font-semibold text-gray-700">Sujet</label>
            <input type="text" id="subject" name="subject" value={formData.subject} onChange={handleChange} required className="px-4 py-2 rounded-lg border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-400" />
          </div>
          <div className="flex flex-col gap-2">
            <label htmlFor="message" className="font-semibold text-gray-700">Message</label>
            <textarea id="message" name="message" value={formData.message} onChange={handleChange} required rows={5} className="px-4 py-2 rounded-lg border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-400 resize-y" />
          </div>
          <button type="submit" className="bg-blue-600 text-white font-semibold py-3 rounded-lg mt-2 hover:bg-blue-700 transition">Envoyer</button>
        </form>
        {/* Info */}
        <div className="flex-1 bg-white/90 rounded-2xl shadow-xl p-8 flex flex-col gap-6 justify-center backdrop-blur-md">
          <h2 className="text-xl font-bold text-gray-800 mb-2">Informations de contact</h2>
          <div className="text-gray-700 mb-2">
            <span className="font-semibold">Adresse:</span><br />
            67 rue aziz bellal maarif, Casablanca, Maroc
          </div>
          <div className="text-gray-700 mb-2">
            <span className="font-semibold">Email:</span><br />
            info@watson.ma
          </div>
          <div className="text-gray-700 mb-2">
            <span className="font-semibold">Téléphone:</span><br />
            +212 662-362121
          </div>
          <div className="flex gap-4 mt-4">
            <a href="https://facebook.com" target="_blank" rel="noopener noreferrer" className="text-blue-600 hover:text-blue-800 text-2xl"><i className="fab fa-facebook" /></a>
            <a href="https://linkedin.com" target="_blank" rel="noopener noreferrer" className="text-blue-700 hover:text-blue-900 text-2xl"><i className="fab fa-linkedin" /></a>
            <a href="https://twitter.com" target="_blank" rel="noopener noreferrer" className="text-blue-400 hover:text-blue-600 text-2xl"><i className="fab fa-twitter" /></a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
